import React from 'react';
import { BrowserRouter, Route} from 'react-router-dom/cjs/react-router-dom.min';
import './App.css';

const Home = () => {
  return (
    <div>
      Page One
    </div>
  )
}


class App extends React.Component {
  render() {
    return (
      <div className="Navbar">
        <BrowserRouter path="/" exact Component={Home}>
          <h2>Home</h2>
          <h2>Clothes</h2>
          <h2>Pets</h2>
          <h2>Furniture</h2>
          <h2>Electronics</h2>
          <h3 className='Cart'>Cart</h3>
        </BrowserRouter>
      </div>
    )
  }
}
export default App;
